import React from "react";

function Title(props) {
  return (
    <div
      style={{
        width: "90%",
        color: "white",
        fontSize: 36,
        margin: "5%",
      }}
    >
      {props.val}
    </div>
  );
}

function Description(props) {
  return (
    <div
      style={{
        width: "90%",
        color: "gray",
        fontSize: 14,
        margin: "5%",
      }}
    >
      {props.val}
    </div>
  );
}

export { Title, Description };
